import { Component, OnInit, OnDestroy } from '@angular/core';
import { HttpResponse, HttpErrorResponse } from '@angular/common/http';
import { Subscription } from 'rxjs';
import { AlertService } from 'app/core/util/alert.service';
import { EventManager } from 'app/core/util/event-manager.service';
import { JobInstance } from './job-instance.model';
import { JobInstanceService } from './job-instance.service';
import { ITEMS_PER_PAGE } from 'app/config/pagination.constants';
import { AccountService } from 'app/core/auth/account.service';

@Component({
  selector: 'ic-job-instance',
  templateUrl: './job-instance.component.html',
})
export class JobInstanceComponent implements OnInit, OnDestroy {
  jobInstances: JobInstance[];
  currentAccount: any;
  eventSubscriber?: Subscription;
  itemsPerPage: number;
  links: any;
  page: any;
  predicate!: string;
  queryCount: any;
  reverse: any;
  totalItems?: number;

  constructor(
    private jobInstanceService: JobInstanceService,
    private alertService: AlertService,
    private eventManager: EventManager,
    private accountService: AccountService
  ) {
    this.jobInstances = [];
    this.itemsPerPage = ITEMS_PER_PAGE;
    this.page = 0;
    this.links = {
      last: 0,
    };
    this.predicate = 'id';
    this.reverse = true;
  }

  loadAll(): void {
    this.jobInstanceService
      .query({
        page: this.page,
        size: this.itemsPerPage,
        sort: this.sort(),
      })
      .subscribe(
        (res: HttpResponse<string[]>) => this.onSuccess(res.body),
        (res: HttpErrorResponse) => this.onError(res.message)
      );
  }

  reset(): void {
    this.page = 0;
    this.jobInstances = [];
    this.loadAll();
  }

  loadPage(page: any): void {
    this.page = page;
    this.loadAll();
  }
  ngOnInit(): void {
    this.loadAll();
    this.accountService.identity().subscribe(account => {
      this.currentAccount = account;
    });
    this.registerChangeInJobInstances();
  }

  ngOnDestroy(): void {
    if (this.eventSubscriber) {
      this.eventManager.destroy(this.eventSubscriber);
    }
  }

  trackId(index: number, item: JobInstance): any {
    return item.id;
  }
  registerChangeInJobInstances(): void {
    this.eventSubscriber = this.eventManager.subscribe('jobInstanceListModification', () => this.reset());
  }

  sort(): any {
    const result = [this.predicate + ',' + (this.reverse ? 'asc' : 'desc')];
    if (this.predicate !== 'id') {
      result.push('id');
    }
    return result;
  }

  private onSuccess(data: any): void {
    for (let i = 0; i < data.length; i++) {
      this.jobInstances.push(data[i]);
    }
  }

  private onError(error: any): void {
    this.alertService.addAlert({ type: 'danger', translationKey: error.message });
  }
}
<div>
  <h2>
    <span icTranslate="jobWebApp.jobInstance.home.title">Job Instances</span>
  </h2>
  <ic-alert></ic-alert>
  <div class="row"></div>
  <br />
  <div class="card">
    <div class="card-header"><span icTranslate="acmAdmin.home.SearchResult">Search Criteria</span></div>
    <div class="card-block" style="padding: 1.5% 1.5% 0 1.5%">
      <div class="table-responsive" *ngIf="jobInstances">
        <table class="table table-striped">
          <thead>
            <tr icSort [(predicate)]="predicate" [(ascending)]="reverse" [callback]="reset.bind(this)">
              <th scope="col" icSortBy="jobName">
                <span icTranslate="jobWebApp.jobInstance.jobName">Job Name</span> <fa-icon [icon]="'sort'"></fa-icon>
              </th>
            </tr>
          </thead>
          <tbody
            infinite-scroll
            (scrolled)="loadPage(page + 1)"
            [infiniteScrollDisabled]="page >= links['last']"
            [infiniteScrollDistance]="0"
          >
            <tr *ngFor="let jobInstance of jobInstances; trackBy: trackId">
              <td>{{ jobInstance }}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  </div>
</div>
